DROP TABLE IF EXISTS `post_comments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `post_comments` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `post_id` bigint NOT NULL COMMENT '帖子ID',
  `user_id` bigint NOT NULL COMMENT '用户ID',
  `is_anonymous` tinyint(1) DEFAULT '0' COMMENT '是否匿名',
  `parent_id` bigint DEFAULT NULL COMMENT '父评论ID',
  `quote_type` enum('none','post','topic_comment','comment','topic') COLLATE utf8mb4_unicode_ci DEFAULT 'none' COMMENT '引用类型',
  `quote_id` int DEFAULT NULL COMMENT '引用来源ID',
  `quote_content` text COLLATE utf8mb4_unicode_ci COMMENT '引用内容快照',
  `quote_user_id` int DEFAULT NULL COMMENT '被引用内容的作者ID',
  `quote_user_name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '被引用内容的作者昵称',
  `quote_user_avatar` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '被引用内容的作者头像',
  `content` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '评论内容',
  `like_count` int DEFAULT '0' COMMENT '点赞数',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `mentions` json DEFAULT NULL,
  `is_visible` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `idx_post_id` (`post_id`),
  KEY `idx_user_id` (`user_id`),
  KEY `idx_parent_id` (`parent_id`),
  KEY `idx_post_comments_is_anonymous` (`is_anonymous`),
  KEY `idx_post_parent_visible` (`post_id`,`parent_id`,`is_visible`,`created_at`),
  CONSTRAINT `post_comments_ibfk_1` FOREIGN KEY (`post_id`) REFERENCES `posts` (`id`) ON DELETE CASCADE,
  CONSTRAINT `post_comments_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `post_comments_ibfk_3` FOREIGN KEY (`parent_id`) REFERENCES `post_comments` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='帖子评论表';
